                /*
          Simple client-side product renderer and cart interactions.
          - Uses arrays of product objects for each category
          - Renders responsive Bootstrap cards into grid containers
          - Adds basic "Add to Cart" behavior and updates the cart count
          - This is client-side-only and intended as a demo scaffold
        */

        // Sample product data for categories
        const PRODUCTS = {
            electronics: [
                { id: 'e1', name: 'Wireless Headphones', price: 79.99, oldPrice: 99.99, img: 'data:image/jpeg;base64,' },
                { id: 'e2', name: 'Smart Watch', price: 199.99, oldPrice: null, img: 'data:image/jpeg;base64,', discount: '20%' },
                { id: 'e3', name: 'Portable Charger', price: 29.00, oldPrice: 39.00, img: 'data:image/jpeg;base64,' },
                { id: 'e4', name: 'Gaming Mouse', price: 39.00, oldPrice: null, img: 'data:image/jpeg;base64,' },
                { id: 'e5', name: 'Action Camera', price: 129.00, oldPrice: 159.00, img: 'data:image/jpeg;base64,' },
                { id: 'e6', name: 'Bluetooth Speaker', price: 49.00, oldPrice: null, img: 'data:image/jpeg;base64,' }
            ],
            women: [
                { id: 'w1', name: 'Leather Handbag', price: 59.99, oldPrice: 79.99, img: 'data:image/jpeg;base64,' },
                { id: 'w2', name: 'Gold Necklace', price: 129.99, oldPrice: null, img: 'data:image/jpeg;base64,' },
                { id: 'w3', name: 'Silk Scarf', price: 19.99, oldPrice: null, img: 'data:image/jpeg;base64,' },
                { id: 'w4', name: 'Sunglasses', price: 24.99, oldPrice: 39.99, img: 'data:image/jpeg;base64,' },
                { id: 'w5', name: 'Fashion Belt', price: 14.99, oldPrice: null, img: 'data:image/jpeg;base64,' },
                { id: 'w6', name: 'Evening Clutch', price: 34.99, oldPrice: 49.99, img: 'data:image/jpeg;base64,' }
            ],
            men: [
                { id: 'm1', name: 'Casual Shirt', price: 29.99, oldPrice: 39.99, img: 'data:image/jpeg;base64,' },
                { id: 'm2', name: 'Wrist Watch', price: 89.99, oldPrice: 129.99, img: 'data:image/jpeg;base64,' },
                { id: 'm3', name: 'Running Shoes', price: 59.99, oldPrice: 79.99, img: 'data:image/jpeg;base64,' },
                { id: 'm4', name: 'Leather Wallet', price: 24.99, oldPrice: null, img: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRrt6uVQcdtfnTjlnG-X_wh6WTR8mdC3k73FA&s' },
                { id: 'm5', name: 'Sunglasses', price: 19.99, oldPrice: 29.99, img: 'data:image/jpeg;base64,' },
                { id: 'm6', name: 'Denim Jacket', price: 69.99, oldPrice: 89.99, img: 'data:image/jpeg;base64,' }
            ],
            baby: [
                { id: 'b1', name: 'Baby Stroller', price: 129.99, oldPrice: null, img: 'data:image/jpeg;base64,' },
                { id: 'b2', name: 'Baby Diapers (Pack)', price: 9.99, oldPrice: null, img: 'data:image/jpeg;base64,' },
                { id: 'b3', name: 'Soft Toy', price: 12.99, oldPrice: 19.99, img: 'data:image/jpeg;base64,' },
                { id: 'b4', name: 'Baby Bottle Set', price: 16.99, oldPrice: null, img: 'data:image/jpeg;base64,' },
                { id: 'b5', name: 'Baby Monitor', price: 59.99, oldPrice: 79.99, img: 'data:image/jpeg;base64,' },
                { id: 'b6', name: 'Crib Bedding', price: 39.99, oldPrice: null, img: 'data:image/jpeg;base64,' }
            ],
            groceries: [
                { id: 'g1', name: 'Olive Oil 1L', price: 8.99, oldPrice: 12.99, img: 'data:image/jpeg;base64,' },
                { id: 'g2', name: 'Organic Honey', price: 6.49, oldPrice: null, img: 'data:image/jpeg;base64,' },
                { id: 'g3', name: 'Premium Rice 5kg', price: 24.99, oldPrice: null, img: 'data:image/jpeg;base64,' },
                { id: 'g4', name: 'Ground Coffee 250g', price: 7.99, oldPrice: null, img: 'data:image/jpeg;base64,' },
                { id: 'g5', name: 'Pasta 500g', price: 2.99, oldPrice: null, img: 'data:image/jpeg;base64,' },
                { id: 'g6', name: 'Cereal Box', price: 4.99, oldPrice: 6.99, img: 'data:image/jpeg;base64,' }
            ]
        };

        // Simple in-memory cart
        let CART = {};

        // Utility: format price
        function fmt(price) { return '$' + price.toFixed(2); }

        // Render products into a container (id) using a grid of cards
        function renderProducts(containerId, products) {
            const container = document.getElementById(containerId);
            if (!container) return;
            container.innerHTML = '';

            // For each product, create a Bootstrap column + card
            products.forEach(product => {
                const col = document.createElement('div');
                col.className = 'col-6 col-md-4 col-lg-2 mb-4';

                const card = document.createElement('div');
                card.className = 'card product-card h-100 position-relative border-0';

                // Discount badge
                if (product.oldPrice && product.oldPrice > product.price) {
                    const percent = Math.round((1 - (product.price / product.oldPrice)) * 100) + '%';
                    const badge = document.createElement('div');
                    badge.className = 'discount-badge';
                    badge.textContent = '-' + percent;
                    card.appendChild(badge);
                } else if (product.discount) {
                    const badge = document.createElement('div');
                    badge.className = 'discount-badge';
                    badge.textContent = product.discount;
                    card.appendChild(badge);
                }

                card.innerHTML += `
            <img src="${product.img}" loading="lazy" decoding="async" onerror="this.onerror=null;this.src='data:image/svg+xml,%3Csvg xmlns=%27http://www.w3.org/2000/svg%27 width=%27400%27 height=%27200%27%3E%3Crect fill=%27%23f0f0f0%27 width=%27400%27 height=%27200%27/%3E%3Ctext x=%2750%25%27 y=%2750%25%27 text-anchor=%27middle%27 dy=%27.3em%27 fill=%27%23999%27 font-family=%27sans-serif%27 font-size=%2718%27%3EImage Not Available%3C/text%3E%3C/svg%3E'" class="card-img-top product-img" alt="${escapeHtml(product.name)}">
            <div class="card-body d-flex flex-column">
                <h6 class="card-title mb-2">${escapeHtml(product.name)}</h6>
                <div class="mb-2">
                    <span class="price">${fmt(product.price)}</span>
                    ${product.oldPrice ? `<span class="ms-2 old-price">${fmt(product.oldPrice)}</span>` : ''}
                </div>
                <div class="mt-auto d-flex justify-content-between align-items-center">
                    <button class="btn btn-sm btn-primary add-to-cart" data-id="${product.id}" aria-label="Add ${escapeHtml(product.name)} to cart">Add to Cart</button>
                    <button class="btn btn-outline-secondary btn-sm"><i class="bi bi-heart"></i></button>
                </div>
            </div>
        `;

                col.appendChild(card);
                container.appendChild(col);
            });
        }

        // Global image error fallback with optimized error handling
        document.addEventListener('DOMContentLoaded', function () {
            // Create an optimized SVG placeholder
            const svgFallback = 'data:image/svg+xml,%3Csvg xmlns=%27http://www.w3.org/2000/svg%27 width=%27400%27 height=%27300%27%3E%3Crect fill=%27%23f0f0f0%27 width=%27400%27 height=%27300%27/%3E%3Ctext x=%2750%25%27 y=%2750%25%27 text-anchor=%27middle%27 dy=%27.3em%27 fill=%27%23999%27 font-family=%27sans-serif%27 font-size=%2716%27%3EImage Unavailable%3C/text%3E%3C/svg%3E';

            // Handle static images
            document.querySelectorAll('img').forEach(img => {
                if (img.src) {
                    // Mark image as loading
                    img.classList.add('img-loading');

                    // Listen for errors
                    img.addEventListener('error', function () {
                        if (this.src !== svgFallback) {
                            console.warn('Image failed to load:', this.src);
                            this.src = svgFallback;
                        }
                        this.classList.remove('img-loading');
                    }, { once: true });

                    // Listen for successful load
                    img.addEventListener('load', function () {
                        this.classList.remove('img-loading');
                    }, { once: true });

                    // Check if already loaded or broken
                    if (img.complete) {
                        if (img.naturalHeight === 0) {
                            img.src = svgFallback;
                        }
                        img.classList.remove('img-loading');
                    }
                }
            });

            // Observe for dynamically added images using IntersectionObserver for better performance
            const imageObserver = new IntersectionObserver((entries) => {
                entries.forEach(entry => {
                    if (entry.isIntersecting) {
                        const img = entry.target;
                        if (img.dataset.src && !img.src) {
                            img.src = img.dataset.src;
                        }
                        imageObserver.unobserve(img);
                    }
                });
            });

            // Monitor for new images
            const mutationObserver = new MutationObserver(function (mutations) {
                mutations.forEach(function (mutation) {
                    mutation.addedNodes.forEach(function (node) {
                        if (node.nodeName === 'IMG') {
                            setupImageHandling(node);
                            imageObserver.observe(node);
                        } else if (node.querySelectorAll) {
                            node.querySelectorAll('img').forEach(img => {
                                setupImageHandling(img);
                                imageObserver.observe(img);
                            });
                        }
                    });
                });
            });
            mutationObserver.observe(document.body, { childList: true, subtree: true });

            function setupImageHandling(img) {
                if (!img.src || img.src === '') return;
                img.classList.add('img-loading');
                img.addEventListener('error', function () {
                    console.warn('Image error:', this.src);
                    this.src = svgFallback;
                    this.classList.remove('img-loading');
                }, { once: true });
                img.addEventListener('load', function () {
                    this.classList.remove('img-loading');
                }, { once: true });
            }
        });

        // Add CSS for loading state
        const style = document.createElement('style');
        style.textContent = `
    img.img-loading {
        background: linear-gradient(90deg, #f0f0f0 25%, #e0e0e0 50%, #f0f0f0 75%);
        background-size: 200% 100%;
        animation: loading 1.5s infinite;
    }
    @keyframes loading {
        0% { background-position: 200% 0; }
        100% { background-position: -200% 0; }
    }
`;
        document.head.appendChild(style);

        // Simple HTML escape for product names
        function escapeHtml(str) {
            return String(str).replace(/[&<>\"]+/g, function (match) {
                return { '&': '&amp;', '<': '&lt;', '>': '&gt;', '"': '&quot;' }[match];
            });
        }

        // Attach Add to Cart handlers (delegation)
        document.addEventListener('click', function (e) {
            const btn = e.target.closest('.add-to-cart');
            if (!btn) return;
            const id = btn.dataset.id;
            addToCart(id);
        });

        function addToCart(productId) {
            // Find product in any category
            let product = null;
            Object.values(PRODUCTS).forEach(list => {
                list.forEach(p => { if (p.id === productId) product = p; });
            });
            if (!product) return;

            if (CART[productId]) CART[productId].qty += 1;
            else CART[productId] = { product: product, qty: 1 };

            updateCartCount();
            // small feedback
            showToast(`${product.name} added to cart`);
        }

        function updateCartCount() {
            const count = Object.values(CART).reduce((s, i) => s + i.qty, 0);
            document.getElementById('cartCount').textContent = count;
        }

        // Lightweight toast feedback
        function showToast(message) {
            const t = document.createElement('div');
            t.className = 'toast align-items-center text-bg-dark border-0 show position-fixed top-0 end-0 m-3';
            t.setAttribute('role', 'alert');
            t.innerHTML = `
        <div class="d-flex">
            <div class="toast-body">${escapeHtml(message)}</div>
            <button type="button" class="btn-close btn-close-white me-2 m-auto" data-bs-dismiss="toast" aria-label="Close"></button>
        </div>
    `;
            document.body.appendChild(t);
            setTimeout(() => t.classList.remove('show'), 2500);
            setTimeout(() => t.remove(), 3000);
        }

        // Search form behavior: simple client-side filter across categories
        document.getElementById('searchForm').addEventListener('submit', function (e) {
            e.preventDefault();
            const q = document.getElementById('searchInput').value.trim().toLowerCase();
            if (!q) return;
            // gather all products and filter
            const all = [].concat(...Object.values(PRODUCTS));
            const results = all.filter(p => p.name.toLowerCase().includes(q));

            // render results into a temporary modal-like area: replace main content
            const main = document.querySelector('main');
            main.scrollIntoView({ behavior: 'smooth' });
            main.innerHTML = `
        <div class="mb-4">
            <div class="section-title mb-3">
                <h3>Search results for "${escapeHtml(q)}"</h3>
                <a href="#" class="text-decoration-none" id="clearSearch">Clear</a>
            </div>
            <div class="row" id="searchResults"></div>
        </div>
    `;
            renderProducts('searchResults', results);
            document.getElementById('clearSearch').addEventListener('click', function (ev) { ev.preventDefault(); location.reload(); });
        });

        // Initialize page: render all category grids
        function init() {
            renderProducts('electronicsGrid', PRODUCTS.electronics);
            renderProducts('womenGrid', PRODUCTS.women);
            renderProducts('menGrid', PRODUCTS.men);
            renderProducts('babyGrid', PRODUCTS.baby);
            renderProducts('groceriesGrid', PRODUCTS.groceries);

            // restore cart from localStorage if present
            try {
                const saved = localStorage.getItem('shophub_cart');
                if (saved) { CART = JSON.parse(saved); updateCartCount(); }
            } catch (e) { /* ignore */ }

            // save cart periodically
            setInterval(() => localStorage.setItem('shophub_cart', JSON.stringify(CART)), 2000);
        }

        // Run init after DOM ready
        if (document.readyState === 'loading') document.addEventListener('DOMContentLoaded', init);
        else init();

        // Initialize and optimize Bootstrap carousels for proper auto-play
        document.addEventListener('DOMContentLoaded', function () {
            try {
                // Initialize all carousels with proper settings
                const carousels = document.querySelectorAll('.carousel');
                carousels.forEach(carousel => {
                    // Get interval from data attribute or use default
                    const interval = carousel.getAttribute('data-bs-interval') || 4000;
                    const pause = carousel.getAttribute('data-bs-pause') || 'hover';

                    // Create Bootstrap Carousel instance with proper options
                    const bsCarousel = new bootstrap.Carousel(carousel, {
                        interval: parseInt(interval),
                        pause: pause,
                        wrap: true,
                        keyboard: true,
                        ride: true
                    });

                    // Ensure carousel keeps cycling
                    carousel.addEventListener('slid.bs.carousel', function () {
                        if (!bsCarousel._isSliding) {
                            bsCarousel.cycle();
                        }
                    });
                });
                console.log('Carousels initialized successfully:', carousels.length);
            } catch (e) {
                console.error('Carousel initialization error:', e);
            }
        });